script: |
  super -f text -I q6633.spq | sort > q6633.out

inputs:
  - name: q6633.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE NOT NULL NOT BETWEEN NULL AND 63 + col0 OR NOT - col1 * - - 43 + - col2 / + - col1 + + col1 * + col0 * col2 IS NULL;
  - name: tab1

outputs:
  - name: q6633.out
    data: |
      51	14	96
      85	5	59
      91	47	68
